import React from "react";

export default function Home() {
  return (
    <div>
      {/* <img src={logo} alt="tableauImage" /> */}
      <h1>Spring Break Visualizer</h1>
      <p>by Kevin Arackaparambil</p>
      <p>Feel free to browse the Tableau visualizations in the "DATA" page.</p>
      <p>To contribute to the data set, please fill out the form in the "FORM" page.</p>
      <p>Thanks for looking around!</p>
    </div>
  );
}
